import React, {Component} from 'react';
import {Link} from 'react-router-dom';

class Header extends Component {
  constructor(props) {
    super(props);

    this.state = {
      page: this.props.page
    }
  }

  render() {
    return (
      <header className="App-header">
        <div>
          <button type="button" className="App-header-name">
            <Link to="/">meredith young-ng</Link>
          </button>
        </div>
        <div className="App-header-pages">
          <button type="button">
            <Link to="/"><span id="headerActive">about</span></Link>
          </button>
          <button type="button">
            <Link to="/work"><span id="headerActive">work</span></Link>
          </button>
        </div>
      </header>
    );
  }
}

export default Header;
